p.note:
There are numerous ink drawings in the margins. These are drawn with the same type of ink as the main text and are similar in style to the heads and figures that decorate the initials. They are often filled in with one or several colours. These figures sometimes seem to give emphasis to different passages in the text. Motives: 
                                        Monk's head 









                                        ;
                                        Bishop's head , ;
                                        Money bag ; 
                                        Lion ;
                                        Agnus Dei ;
                                        Four arrows ;
                                        Man's head , ;
                                        Animal head ;  
                                        Bell ;
                                        Sword .
